import React, { Component } from "react";
import ReactDOM from "react-dom";

class Search extends Component {
  state = {};
  constructor(props) {
    super(props);
    this.state = {
      username: "",
      age: null
    };
  }
  mySubmitHandler = event => {
    alert("You are submitting " + this.state.age);
  };
  myChangeHandler = event => {
    let nam = event.target.name;
    let val = event.target.value;
    if (nam === "age") {
      if (!Number(val)) {
        alert("Your age must be a number");
      }
    }
    this.setState({ [nam]: val });
  };
  mySHandler = event => {
    this.setState({ sname: event.target.value });
  };
  render() {
    return (
      <React.Fragment>
        <form id="form">
          <h1>
            Hello {this.state.username} {this.state.age}
          </h1>
          <p>
            <i>
              {" "}
              <input
                type="text"
                className="input"
                placeholder="Class"
                id="classInput"
                onChange={this.myChangeHandler}
              />
            </i>
            <i>
              <input
                type="text"
                className="input"
                placeholder="Search..."
                id="searchInput"
                onChange={this.myChangeHandler}
              />{" "}
            </i>
          </p>
          <input type="submit" onclick="cname();" />
        </form>
      </React.Fragment>
    );
  }
}

export default Search;

function cname() {
  var cinput = document.getElementById("classInput").value;
  alert("dscdscdscdscs");
}

function sname() {
  var sinput = document.getElementById("searchInput").value;
  alert(sinput);
}
